(4498, 1445, 563, 5, '虧欠', '', '2007-11-03 00:00:00', 0000, 25, 0, 4, '', '\n走了好遠\n再也看不見藍天\n你的臉是不是疲倦\n我也忘了相識從前\n不曾改變\n再也聽不見繁華的街\n你的話語迴盪在耳邊\n\n充斥\n回憶空間\n你無所謂\n是否傷了你的心肺\n我知道是我不對\n讓我擁有明天\n\n讓時間濃縮我的虧欠\n藉著雪輕輕落到你的面前\n望著手中\n娓娓的白雪\n錯過了再見一次的機會', 412, '', '', '', '', '', '', 1, 1, 0, '2008-05-21 05:27:17', '2015-03-12 13:32:26', '0000-00-00 00:00:00'),
